<html>
<head>
<title>SketchUp</title>
<style type="text/css">
  td {font-family: lucida grande; font-size: 10; white-space:nowrap;}
  .leftcol {text-align: right;}
  .centercol {text-align: center;}
</style>
</head>
<body>
<center>
<table border=0 width="100%">
<!-- The URL_PLACEHOLDER strings are used by SketchUp to fill in actual
     localized URLs and labels.  The localized URLs come from SketchUp.dat; the
     localized labels come from Localizable.strings.
 -->
<tr><td class="leftcol" width=33%>Info:</td><td>{SKETCHUP_INFO_URL_PLACEHOLDER}</td></tr>
<tr><td class="leftcol" width=33%>Support:</td><td>{SKETCHUP_SUPPORT_URL_PLACEHOLDER}</td></tr>
<tr><td class="leftcol" width=33%>License:</td><td>{SKETCHUP_LICENSE_URL_PLACEHOLDER}</td></tr>
<tr><td width=33%></td><td>{SKETCHUP_API_URL_PLACEHOLDER}</td></tr>
<tr><td width=33%></td><td>{SKETCHUP_OPEN_SOURCE_CREDITS_URL_PLACEHOLDER}</td></tr>
<tr><td colspan=2>&nbsp;</td></tr>
<tr><td class="centercol">&copy; 2016 Trimble Inc.</td></tr>
<tr><td class="centercol">Patent 6,628,279</td></tr>
</table>
</center>
</body>
</html>
